async () => {
  var favorecidos = await CarregarFavorecidosAPI.run().catch(async () => {
    await showAlert('Ocorreu algum erro ao carregar os favorecidos');
  });
  var select_data = [];
  for (var e of favorecidos) {
    select_data.push({
      label: e.nome,
      value: e.id
    });
  }
  await storeValue('favorecidosCP', select_data);
}

